//常规遍历O(mn)
class Solution {
public:
    int strStr(string haystack, string needle) {
    	if(needle.size()==0) return 0;

        for(int i=0;i<haystack.size();i++){
        	if(haystack[i]==needle[0]){
        		for(int j=1;j<needle.size();j++){
        			if(haystack[i+j]!=needle[j])
        				break;
        		}
        		if(j>=needle.size){//find the needle
        			return i;
        		}
        	}
        }
        return -1;
    }
};

